import React from 'react';
import { Switch, Route, Redirect, Router } from 'react-router-dom';

import history from 'app/config/history';
import AccountRoutes from './accountRoutes';
import { agentPlatformRoute } from 'app/shared/constant';
import { CookiesStorage } from 'app/shared/utils';
import { LoginContainer } from 'app/module/account';
import { AUTH_ACTION } from 'app/redux/constant';
import { PublicFrame, DefaultFrame } from 'app/shared/component';
import HomeContainer from 'app/module/home';
import i18next from 'app/shared/locales';

const defaultRouteComponent = (props: any) => {
  if (CookiesStorage.authenticated()) {
    return <Redirect to={{ pathname: agentPlatformRoute.Home }} />;
  }
  return <Redirect to={{ pathname: agentPlatformRoute.Login }} />;
};

const Routes = () => (
  <Router history={history}>
    <Switch>
      <Route exact path="/" component={defaultRouteComponent} />
      <PublicFrame exact path={agentPlatformRoute.Login} component={LoginContainer} loadingAction={AUTH_ACTION.LOGIN} />
      <DefaultFrame exact path={agentPlatformRoute.Home} component={HomeContainer} title={i18next.t('page.title.ai')} />
      <Route path={agentPlatformRoute.AccountInfo} component={AccountRoutes} />
    </Switch>
  </Router>
);

export default Routes;
